import './App.css';
import challenges from './challengesList.js';
import './challenges.css';


class CallChallenges extends Component{



 rIndex = () => {
   console.log(Math.floor(Math.random() * challenges.length));
 };


 render(){
   let chall = challenges[this.rIndex()];
   return(
    <div>
      <div class="boxed">
        {chall.Title}
      </div>
       <div>
          <button type="button" class="btn btn-primary btn-lg btn-block" onClick={() => this.rIndex}> Complete</button>
       </div>
    </div>

   );
 }
}

